import logo from './logo.svg';
import './App.css';
import React from 'react';
const rand = require('random-key');

function App() {
  const gen = () => {
    const random = rand.generate();
    //uploadKeyToDB(random);
    return random;
  };
  return (
    <div className='App'>
      <header className='App-header'>
        <img src={logo} className='App-logo' alt='logo' />
        <form action='/bruh.bruh'>
          <input></input>
          <button type='submit'>bruh</button>
        </form>
      </header>
    </div>
  );
}

export default App;
